	NodeTest.NAMETESTPREFIXANY = 1;
	NodeTest.NAMETESTQNAME = 2;
	NodeTest.COMMENT = 3;
	NodeTest.TEXT = 4;
	NodeTest.PI = 5;
	NodeTest.NODE = 6;
	
